import { useGoogleApi } from 'react-gapi'
var PROJECT_ID = 'summer-of-jake-adventure-map';
var CLIENT_ID = '26369649025-easrr4v2jrn7mdfe5npv8lnjon2c3uj2.apps.googleusercontent.com';
var API_KEY = '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';
var SCOPES = 'https://www.googleapis.com/storage/';
var API_VERSION = 'v1';
var BUCKET_NAME = 'strava-kmls';

const gapi = useGoogleApi({
    scopes: [
      'storage'
    ],
  }
)

/**
    * Load the Google storage API.
*/
function initializeApi() {
    gapi.client.load('storage', API_VERSION);
  }
/**
 * Authorize Google Compute Engine API.
 */
function authorization() {
  gapi.client.setApiKey(API_KEY);
  gapi.auth.authorize({
    client_id: CLIENT_ID,
    scope: SCOPES,
    immediate: false
  }, function(authResult) {
       if (authResult && !authResult.error) {
         window.alert('Auth was successful!');
       } else {
         window.alert('Auth was not successful');
       }
     }
  );
}


class RouteURLService {
    getRoutes() {
        var request = gapi.client.storage.objects.list({
            'bucket': BUCKET_NAME
        });
        request.execute(function(resp) {
            console.log(resp);
        })
    }
}

export default new RouteURLService();
